import React from 'react';
import { StyleSheet, Button, View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Home Screen</Text>
      <Button
        title="Go to Details"
        onPress={() => navigation.navigate('Details')}
      />
    </View>
  );
}

function ManualScreen({ navigation }) {
  return (
    <View style={styles.container}>
    <View style={styles.section}>
      <Text size={30} color="#19e7f7">
        Manual Entry
      </Text>
      <Button title="Go to Home" onPress={() => navigation.navigate('Home')} />
    </View>
    <View style={styles.componentsSection}>
        <Text style={styles.componentSectionHeader}>Select food: </Text>
        <Dropdown
          style={{ width: '100%', alignSelf: 'center', color: '#66fcf1' }}
          // add what to do on select
          onSelect={() => {
            // console.log("hello world")
          }}
          items={['Bread', 'Beer', 'Rice', 'Potatoes', 'Oatmeal', 'Nuts', 'Peas']}
          // items={ getFoods }
        />
        <View style={styles.buttonStyle}>
            <Button color="#ffffff">Add item</Button>
        </View>
      </View>
      <View style={styles.section}>
        <View style={styles.buttonStyle}>
            <Button color="#ffffff">Done</Button>
        </View>
      </View>
  </View>
  );
}

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Home">
        <Stack.Screen name="Home" component={HomeScreen} />
        <Stack.Screen name="Details" component={ManualScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#66FDF1',
    paddingHorizontal: 15,
    paddingTop: 20,
  },
  buttonStyle: {
    borderColor: '#C5C6C7',
    borderWidth: 4,
    marginTop: 50,
    marginHorizontal: 100,
  },
  section: {
    marginBottom: 30,
    paddingHorizontal: 20,
    justifyContent: 'center',
    alignItems: 'center',
  },
  sectionHeader: {
    marginBottom: 8,
  },
  componentsSection: {
    backgroundColor: '#1f2833',
    paddingHorizontal: 16,
    paddingVertical: 24,
    marginBottom: 20,
    borderRadius: 5,
    borderColor: '#c5c6c7',
    borderWidth: 4
  },
  componentSectionHeader: {
    // fontFamily: fonts.primaryRegular,
    color: '#ffffff',
    fontSize: 24,
    marginBottom: 20,
  },
  demoButtonsContainer: {
    flex: 1,
    flexDirection: 'row',
    flexWrap: 'wrap',
    alignItems: 'center',
    justifyContent: 'space-between',
  },
  demoIconsContainer: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    flex: 1,
    alignItems: 'center',
    justifyContent: 'space-between',
    paddingHorizontal: 3,
    marginBottom: 20,
  },
  demoButton: {
    marginTop: 8,
    marginBottom: 8,
  },
  demoItem: {
    marginVertical: 15,
  },
});



export default App;
